import React from 'react';                                                      //React component
import { BrowserRouter as Router, Redirect, Route, Switch, useLocation } from 'react-router-dom';      //Document Object Model - Link
import './App.css';                                                                              
import Navbar from './Components/Navbar';
import Home from './Components/pages/HomePages/Home';
import Service from './Components/pages/Services/Service';
import Product from './Components/pages/Product/Product';
import Footer from './Components/pages/Footer/Footer';
import SignUp from './Components/pages/SignUp/SignUp';
import ErrorPage from './Components/pages/ErrorPage';

function App(){
    var redirectHome = true;
    var gotoPath

    if (redirectHome) {
        gotoPath = <Redirect to = "/" />;
        redirectHome = false
    } else {
        gotoPath = <Redirect to = "/Error404" />;
    }
    //Router should enclose the the <Link>
    //To switch the page route we use <Switch><Route></Switch><Route path="" component={ErrorPage}/>
    return(
        <Router>                 
            <Navbar/>
            <Switch>
                <Route exact path="/"  component={Home}/>
                <Route exact path="/service" component={Service}/>
                <Route exact path="/product" component={Product}/>
                <Route exact path="/sign-up" component={SignUp}/>
                <Route path="/Error404" component={ErrorPage}/>
                {gotoPath}
            </Switch>
            <Footer/>
        </Router>
    );
}

export default App;
